import React from "react";

const MoveCard = ({ nombre_cliente, nombre_producto, monto, tipo }) => {
  return (
    <div
      className={` w-2/4  text-xl rounded font-[Helvetica Neue] m-5 text-white ${
        tipo === "venta" ? "  bg-green" : " bg-yellow"
      } `}
    >
      <h2 className=" text-center">
        {nombre_cliente} ha{" "}
        {tipo === "venta"
          ? "comprado por " + { monto } + " el producto"
          : "ofertado " + { monto } + " por el producto"}
      </h2>
      <br />
      <h2 className=" text-center">{nombre_producto}</h2>
    </div>
  );
};

export default MoveCard;
